import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "Frontend/src/routes/Home";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
